import React from 'react';
import GoogleLogin from 'react-google-login';

const LoginScreen = () => {
  const handleSuccessLogin = (response) => {
    console.log(response);
  };

  const handleFailLogin = (response) => {
    console.log(response);
  };

  return (
    <>
      <div className="container-sm text-center my-5 py-5 shadow bg-light">
        <h1>Sign in Here</h1>

        <GoogleLogin
          className="mt-2 text-center"
          clientId="329337993518-7u332kcuq9agn3h1nec249froda0bqp3.apps.googleusercontent.com"
          buttonText="Log in with Google"
          onSuccess={handleSuccessLogin}
          onFailure={handleFailLogin}
          cookiePolicy={'single_host_origin'}
          theme="dark"
        />
      </div>
    </>
  );
};

export default LoginScreen;
